def minion_game(string):
    if len(string)>0 and len(string)<(1000**2):
        vowels=['A','E','I','O','U']
        c_coll=[]
        v_coll=[]
        for i in range(len(string)):
            for j in range(i+1,len(string)+1):
                word=string[i:j]
                if word[0] in vowels:
                    v_coll.append(word)
                else:
                    c_coll.append(word)
        c_count=0
        v_count=0
        for i in range(len(c_coll)):
            c_count+=1
        for i in range(len(v_coll)):
            v_count+=1

        if c_count>v_count:
            print(f'Stuart {c_count}')
        elif v_count>c_count:
            print(f'Kevin {v_count}')
        else:
            print('Draw')
    return 
minion_game('')